import React, { useState } from 'react';
import './whattsappCall.css';
const WhatSappCall = () => {
  const [formData, setFormData] = useState({
    name: '',
    ville:'Laâyoune',
    tele: '',
    email: '',
    message: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prevState => ({
      ...prevState,
      [name]: value
    }));
  };

  const sendWhatsApp = () => {
    const { name, email, country, message } = formData;
    const phoneNumber = "+6285101556689";
    const url = "https://wa.me/" + phoneNumber + "?text=" +
      "*Nom :* " + name + "%0a" +
      "*Ville :* " + ville + "%0a" +
      "*Telephone:* " + tele + "%0a" +
      "*Email :* " + email +
      "*Message :* " + mess +
      "%0a%0a" +
      "This is an example of sending HTML form data to WhatsApp";

    window.open(url, '_blank').focus();
  };

  return (
    <div id="divFormCall" className="div-block-234" style={{ display: 'block' }}>
      <div className="div-block-269">
        <div className="div-block-235" style={{ backgroundColor: 'black' }}>
          <img style={{ marginRight: '18px' }} src="assistance.png" loading="lazy" width="78" alt="" className="image-112" />
          <div className="text-block-163">Discutez avec un agent</div>
          <div id="btnFormCallClose" className="div-block-237" >
            <img src="arrow-down-sign-to-navigate-1.png" loading="lazy" width="11" alt="" />
          </div>
        </div>
        <div className="div-block-247">
          <div className="form-block-3 w-form">
            <form id="formCallMe" className="form-4" aria-label="Formulaire de rappel">
              <label htmlFor="fullName" className="field-label">Nom &amp; prénom</label>
              <input type="text" className="text-field-6 w-input" autoComplete="off" maxLength="256" name="fullName" placeholder="Entrer votre nom" id="fullName" value={formData.name} onChange={handleChange} required />
              <label htmlFor="city" className="field-label">Ville</label>
              <select id="city" name="field-2" data-name="Field 2" className="text-field-6 w-select" value={formData.ville} onChange={handleChange} required>
                <option value="Casablanca">Laâyoune</option>
                <option value="Rabat">Boujdour</option>
                <option value="Marrakech">Es-Semara</option>
              </select>
              <label htmlFor="phone" className="field-label">Tél.</label>
              <input type="text" className="text-field-6 w-input" autoComplete="off" maxLength="256" name="phone" placeholder="Entrer votre téléphone" id="phone" value={formData.tele} onChange={handleChange} required />

              <label htmlFor="email" className="field-label">Email</label>
              <input type="text" className="text-field-6 w-input" autoComplete="off" maxLength="256" name="email" placeholder="Entrer votre adresse email" id="email" value={formData.email} onChange={handleChange} required />

              <label htmlFor="theme" className="field-label">Description</label>
              <textarea style={{ resize: 'none', height: '100px' }} className="text-field-6 w-input" autoComplete="off" maxLength="256" name="theme" placeholder="Décrivez votre problème" id="theme" value={formData.message} onChange={handleChange} required></textarea>

              <div className="div-block-236">
                <button type="submit" onClick={sendWhatsApp} id="btnCallMe" style={{ backgroundColor: 'black', color: 'white', height: '40px', fontSize: '13px' }} className="button-20 w-button">
                  <a href=''><i className='fab fa-whatsapp icon'></i></a>
                  <h6>Discutez avec moi !</h6>
                </button>
              </div>
            </form>
            <div className="success-message-4 w-form-done" tabIndex="-1" role="region" aria-label="Succès de la demande de rappel">
              <div style={{ color: 'green' }}>Merci, votre demande a bien été envoyée</div>
            </div>
            <div className="error-message-7 w-form-fail" tabIndex="-1" role="region" aria-label="Échec de la demande de rappel">
              <div style={{ color: 'red' }}>Une erreur s'est produite lors de l'envoi de votre demande. Veuillez réessayer plus tard.</div>
            </div>
          </div>
          <div id="messageRappel" className="div-block-279">
            <div style={{ color: 'blue' }} className="text-block-177">Votre demande de rappel a bien été envoyée !</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default WhatSappCall;
